(1, NULL, 'Trang Chủ Dai Long Asia Home Site', 'trang-chu-dai-long-asia-home-site', 'Trang Chủ Đại Long Asia', 'trang-chu-0oKds8QMBNptjXFk.jpg', 'favicon_trang-chu-QF8ujlY3NqzaiSbc.png', 1, '<p><span style=\"color: #c2e0f4;\">Chuy&ecirc;n cung cấp c&aacute;c giải ph&aacute;p in kỹ thuật số chất lượng cao, giải ph&aacute;p in offset, in c&ocirc;ng nghiệp số lượng lớn, đặc biệt c&aacute;c sản phẩm in ấn như: In bạt hiflex, in decal, in PP, v&agrave; c&aacute;c sản phẩm in Offset số lượng lớn như: tem nh&atilde;n, in danh thiếp card visit, in h&oacute;a đơn số lượng lớn giao ngay, in gia c&ocirc;ng cho c&aacute;c c&ocirc;ng ty, đơn vị quảng c&aacute;o. Thi c&ocirc;ng kỹ thuật, cơ kh&iacute; v&agrave; c&aacute;c giải ph&aacute;p thiết kế cơ kh&iacute;<span style=\"font-size: 13.5pt; font-family: Arial, \'sans-serif\';\">. Cung cấp mực dầu m&aacute;y in KTS Eco Solvent chất lượng cao i3200 TX800 XP600 DX5. </span><a style=\"color: #c2e0f4;\" href=\"https://dailong.asia/\" target=\"_blank\" rel=\"noopener\"><strong><span style=\"font-size: 13.5pt; font-family: Arial, \'sans-serif\';\">DAILONG.ASIA</span></strong></a><span style=\"font-size: 13.5pt; font-family: Arial, \'sans-serif\';\"> l&agrave; trang web ch&iacute;nh thức của </span><strong><span style=\"font-size: 13.5pt; font-family: Arial, \'sans-serif\';\"><a style=\"color: #c2e0f4;\" href=\"https://dailong.asia/\" target=\"_blank\" rel=\"noopener\">C&Ocirc;NG TY TNHH CURIE VIỆT NAM</a>.</span></strong></span></p>\r\n<p style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"font-size: 13.5pt; font-family: Arial, \'sans-serif\'; color: #c2e0f4;\">Địa Chỉ: Đường N14, KP. An H&ograve;a, P. H&ograve;a Lợi, TP. Bến C&aacute;t, B&igrave;nh Dương, VN</span></p>\r\n<p style=\"font-variant-ligatures: normal;