iflex, in offset, hóa đơn nhanh, mực dầu eco solvent i3200 TX800 XP600 DX5 DX10 với chất lượng bản in từ 1 năm trở lên', 'Trang Chủ Đại Long Asia Công TY TNHH Curie Viet Nam, cung cấp các sản phẩm về in và vật tư ngành in, mực in dầu eco solvent i3200 DX5 TX800 XP600 giấy in, decal bạt hiflex, in offset, hóa đơn nhanh', '2022-12-23 23:13:14', '2024-12-05 05:05:13'),
(2, NULL, 'About Us', 'about-us', 'Giới thiệu về chúng tôi dailong.asia', 'about-us-1YUEjZNCVdT4vm7f.png', NULL, 0, '<div class=\"mce-toc\">\r\n<h2>Nội Dung</h2>\r\n<ul>\r\n<li><a href=\"#mcetoc_1hap6f14f15\">Phương Ch&acirc;m Hoạt Động</a></li>\r\n<li><a href=\"#mcetoc_1hap6f14f16\">Sứ mệnh v&agrave; tầm nh&igrave;n</a></li>\r\n<li><a href=\"#mcetoc_1hap6f14f17\">Tại sao lựa chọn t&ecirc;n miền&nbsp;dailong.asia</a></li>\r\n<li><a href=\"#mcetoc_1hap6f14f18\">C&aacute;c dịch vụ ch&uacute;ng t&ocirc;i phục vụ</a></li>\r\n</ul>\r\n</div>\r\n<p><span style=\"font-size: 18px;\"><em>C&ocirc;ng Ty TNHH Curie Việt Nam (Curie Vietnam Ltd.,) h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển từ năm 2010, ban đầu l&agrave; cơ sở Photocopy v&agrave; Record, trải qua thời gian ph&aacute;t triển, C&ocirc;ng ty đầu tư nh&acirc;n lực v&agrave; m&aacute;y m&oacute;c đ&aacute;p ứng nhu cầu in ấn của kh&aacute;ch h&agrave;ng, đến nay C&ocirc;ng ty đ&atilde; đầu tư đầy đủ m&aacute;y m&oacute;c cho c&aacute;c lĩnh vực như: in kỹ thuật số (KTS), in Hiflex, in UV, đặc biệt l&agrave; in 3D v&agrave; in Offset, v&agrave; ch&uacute;ng t&ocirc;i c&oacute; thể đ&aacute;p ứng nhanh nhất tất cả nhu cầu của Kh&aacute;ch h&agrave;ng</em></span></p>\r\n<h2 id=\"mcetoc_1hap6f14f15\"><span style=\"font-size: 18px;\"><em><strong>Phương Ch&acirc;m Hoạt Động</strong></em></span></h2>\r\n<p><span style=\"font-size: 18px;\"><em>Với ng&agrave;nh nghề ch&iacute;nh l&agrave; in ấn c&ocirc;ng ty đ&atilde; khẳng định được m&igrave;nh l&agrave; một trong những địa chỉ tin cậy của c&aacute; nh&acirc;n tổ chức khi sử dụng dịch vụ, l&agrave;m h&agrave;i l&ograve;ng mọi đối tượng khi sử dụng dịch vụ, trong tương lai c&ocirc;ng ty ph&aacute;t triển th&ecirc;m nhiều ng&agrave;nh nghề kh&aacute;c nữa như: x&acirc;y dựng, robot c&ocirc;ng nghiệp,...</em></span></p>\r\n<p><span style=\"font-size: 18px;\"><em>Định hướng của c&ocirc;ng ty trong ng&agrave;nh in ấn tại B&igrave;nh Dương: trở th&agrave;nh nh&agrave; cung cấp, c&ocirc;ng ty dịch vụ số một trong lĩnh vực in offset, in thẻ nhựa, in hiflex, decal, led, alu chữ nổi, mica, inox, in b&aacute;o biểu, tờ rơi, h&oacute;a đơn chất lượng cao,... với mong muốn l&agrave;m h&agrave;i long mọi kh&aacute;ch h&agrave;ng với chất lượng v&agrave; gi&aacute; cả ph&ugrave; hợp nhất.</em></span></p>\r\n<h2 id=\"mcetoc_1hap6f14f16\"><span style=\"font-size: 18px;\"><em><strong>Sứ mệnh v&agrave; tầm nh&igrave;n</strong></em></span></h2>\r\n<p><span style=\"font-size: 18px;\"><em>L&agrave; thương hiệu lớn trong ng&agrave;nh in ấn tại B&igrave;nh Dương cũng như khu vực l&acirc;n cận, với đội ngũ nh&acirc;n vi&ecirc;n thiết kế chuy&ecirc;n nghiệp, thời gian phục vụ tăng l&ecirc;n, thời gian phục vụ cho từng kh&aacute;ch h&agrave;ng với tiến độ nhanh nhất, với tầm nh&igrave;n như vậy trong thời gian tới c&ocirc;ng ty sẽ kh&ocirc;ng ngừng n&acirc;ng cao tay nghề đội ngũ thiết kế cũng như thi c&ocirc;ng, hơn thế nữa đầu tư th&ecirc;m thiết bị m&aacute;y m&oacute;c hiện đại, để chất lượng ng&agrave;y c&agrave;ng tăng.</em></span></p>\r\n<h2 id=\"mcetoc_1hap6f14f17\"><span style=\"font-size: 18px;\"><em><strong>Tại sao lựa chọn t&ecirc;n miền&nbsp;<a href=\"https://www.dailong.asia/admin/page/dailong.asia\" target=\"_blank\" rel=\"noopener\">dailong.asia</a></strong></em></span></h2>\r\n<p><span style=\"font-size: 18px;\"><em>Tiền th&acirc;n x&acirc;y dựng ch&uacute;ng t&ocirc;i ban đầu l&agrave; tiệm quảng c&aacute;o nhỏ lẻ với t&ecirc;n tiện l&agrave; Quảng C&aacute;o Đại Long với mong muốn giữ lại thương hiệu cũ d&ugrave; c&ocirc;ng ty đ&atilde; l&agrave; C&Ocirc;NG TY TNHH CURIE VIỆT NAM, với hoạt động chủ yếu về thiết kế quảng c&aacute;o, in ấn số lượng lớn, kh&aacute;ch h&agrave;ng từ c&aacute; nh&acirc;n hộ gia đ&igrave;nh cho tới doanh nghiệp lớn nhỏ tại khu vực B&igrave;nh Dương cũng như c&aacute;c khu vực l&acirc;n cận, vậy n&ecirc;n ch&uacute;ng t&ocirc;i đ&atilde; lấy t&ecirc;n miền&nbsp;<a href=\"https://www.dailong.asia/admin/page/dailong.asia\" target=\"_blank\" rel=\"noopener\">dailong.asia</a>&nbsp;để l&agrave;m thương hiệu giới thiệu sản phẩm của&nbsp;<a title=\"C&Ocirc;NG TY TNHH CURIE VIỆT NAM\" href=\"https://www.dailong.asia/\" target=\"_blank\" rel=\"noopener\">C&Ocirc;NG TY TNHH CURIE VIỆT NAM</a>, với những sản phẩm chủ lực về in ấn v&agrave; quảng c&aacute;o bao gồm</em></span></p>\r\n<h2 id=\"mcetoc_1hap6f14f18\"><span style=\"font-size: 18px;\"><em>C&aacute;c dịch vụ ch&uacute;ng t&ocirc;i phục vụ</em></span></h2>\r\n<p><span style=\"font-size: 18px;\">IN H&Oacute;A ĐƠN B&Aacute;O BIỂU</span></p>\r\n<p><span style=\"font-size: 18px;\">THIẾT KẾ THI C&Ocirc;NG QUẢNG C&Aacute;O</span></p>\r\n<p><span style=\"font-size: 18px;\">THI C&Ocirc;NG CHỮ NỔI ALU</span></p>\r\n<p><span style=\"font-size: 18px;\">THI C&Ocirc;NG MICA - LED - INOX</span></p>\r\n<p><span style=\"font-size: 18px;\">IN OFFSET DECAL</span></p>\r\n<p><span style=\"font-size: 18px;\">IN BĂNG R&Ocirc;N - DECAL SỮA</span></p>\r\n<p><span style=\"font-size: 18px;\">L&Agrave;M DẤU MỘC C&Aacute; NH&Acirc;N C&Ocirc;NG TY</span></p>\r\n<p><span style=\"font-size: 18px;\">IN BẾ TEM NH&Atilde;N OFFSET</span></p>\r\n<p><span style=\"font-size: 18px;\">IN SI&Ecirc;U TỐC KỸ THUẬT SỐ</span></p>\r\n<p><span style=\"font-size: 18px;\">TEM NH&Atilde;N -&nbsp; THẺ - TEM 7 M&Agrave;U - TEM XI BẠC - TEM CUỘN</span></p>\r\n<p><span style=\"font-size: 18px;\">V&Agrave; C&Aacute;C DỊCH VỤ IN TỔNG HỢP KH&Aacute;C</span></p>\r\n<p><span style=\"font-size: 18px;\">CUNG CẤP MỰC DẦU ECO SOLVENT CHO M&Aacute;Y IN KTS I3200 DX5 DX7 DX10 TX800 XP600 CHẤT LƯỢNG, BẢN IN NGO&Agrave;I TRỜI TỐI THIỂU 1 NĂM 240K/L</span></p>\r\n<p><span style=\"font-size: 18px;\">......</span></p>', 301, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'decal, PP, bạt Hiflex, dailong, asia, in nhanh chất lượng dailong.asia, mực dầu eco solvent cho máy in KTS i3200 TX800 XP600 DX5 DX7 DX10 240K/L', 'gioi thieu ve chung toi Dailong VN cung cấp các sản phẩm in offset, in decal chất lượng cao dailong.asia, mực dầu eco solvent cho máy in KTS i3200 TX800 XP600 DX5 DX7 DX10 240K/L', '2022-12-24 05:06:50', '2024-11-29 08:39:04'),
