(67, 14, 'Blog', 'blog', 'Xuất File AI Adobe Illustrator Sang dạng file in dạng TIFF in chuẩn màu như thiết kế', NULL, 'xuat-file-ai-adobe-illustrator-sang-dang-file-in-dang-tiff-in-chuan-mau-nhu-thiet-ke', 'Bài viết hướng dẫn chi tiết cách làm đúng và so sánh bản in khi lựa hệ màu khác nhau', 'Xuat File AI in CMYK_Bia.jpg', 'normal', NULL, 0, '<p><em><strong>In ấn l&agrave; việc rất quan trong sau khi thiết kế xong, đối với người thiết kế sẽ sử dụng nhiều c&ocirc;ng cụ để thiết kế chứ kh&ocirc;ng phải chỉ sử dụng 1 c&ocirc;ng cụ để ho&agrave;n thiện sản phẩm, bởi v&igrave; 1 sản phẩm kh&ocirc;ng thể đ&aacute;p ứng hết nhu cầu cho 1 việc thiết kế, như: L&agrave;m ảnh th&igrave; 100% sẽ phải sử dụng Photoshop, tạo hiệu ứng th&igrave; phải d&ugrave;ng AI, nhanh đơn giản dễ l&agrave;m th&igrave; sử dụng Corel.</strong></em></p>\r\n<p><em>Trong b&agrave;i n&agrave;y sản phẩm ho&agrave;n thiện l&agrave; file được thiết kế bằng Adobe Illustrator th&igrave; sản phẩm rất đẹp, nhưng sản phẩm in ấn th&igrave; kh&ocirc;ng được như file thiết kế vậy phương ph&aacute;p đ&uacute;ng để xuất file in sẽ như thế n&agrave;o mới đ&uacute;ng v&agrave; chuẩn.</em></p>\r\n<p><span style=\"color: #ff0000;\"><strong><em>Note: TIF hoặc TIFF đều đ&uacute;ng.</em></strong></span></p>\r\n<h2><span style=\"color: #1642fa;\"><strong>1. Cơ bản về hệ m&agrave;u RBG v&agrave; hệ m&agrave;u CMYK</strong></span></h2>\r\n<p>Để hiểu bản chất th&igrave; đầu ti&ecirc;n ch&uacute;ng ta phải hiểu in kỹ thuật số sẽ sử dụng hệ m&agrave;u <strong>CMYK </strong>n&oacute; cũng l&agrave; mực in của m&aacute;y in, vậy CMYK l&agrave; g&igrave;, n&oacute; l&agrave; hệ thống 4 m&agrave;u:<em> C - Cyan M&agrave;u Xanh, M &ndash; Magenta M&agrave;u Đỏ (In ra th&igrave; n&oacute; l&agrave; m&agrave;u hồng), Y &ndash; Yellow M&agrave;u V&agrave;ng, K: Black Đen</em>&nbsp; (sử dụng từ <strong>K</strong> để chỉ m&agrave;u đen v&igrave; nếu sử dụng k&yacute; tự <strong>B</strong> sẽ nhầm lẫn với m&agrave;u <span style=\"color: #1642fa;\"><strong>Blue</strong></span>, ngo&agrave;i ra K c&ograve;n c&oacute; nghĩa l&agrave; Key, mang &yacute; nghĩa l&agrave; chủ yếu, l&agrave; then chốt). T&oacute;m lại <strong>CMYK</strong> = <strong><span style=\"color: #96d4ff;\">Xanh </span><span style=\"color: #ff0000;\"><span style=\"color: #ff5b8d;\">Đỏ</span> </span><span style=\"color: #f9fa0f;\">V&agrave;ng <span style=\"color: #000000;\">Đen</span></span></strong>.</p>\r\n<p>Với hệ m&agrave;u RGB l&agrave; 3 m&agrave;u: <strong><span style=\"color: #ff0000;\">Red - Đỏ</span>, <span style=\"color: #00ff00;\">Green - Xanh lục</span> v&agrave; <span style=\"color: #0000ff;\">Blue - Xanh lam</span></strong></p>\r\n<p>Hệ m&agrave;u <strong>CMYK </strong>tr&ecirc;n phần mềm <strong>Corel Draw</strong> l&agrave; hệ m&agrave;u mặc định cho n&ecirc;n sử dụng phần mềm <strong>Corel </strong>sẽ hiệu quả 100%, nhưng với phần mềm Adobe Illustrator (AI) hệ m&agrave;u mặc định l&agrave; RGB (hệ m&agrave;u n&agrave;y đẹp v&agrave; hiệu ứng rất bắt mắt khi đưa cho kh&aacute;ch h&agrave;ng). Nhưng bản in đ&ocirc;i khi kh&ocirc;ng khớp với bản thiết kế, vậy l&agrave;m sao l&uacute;c chuyển từ hệ m&agrave;u RBG sang hệ m&agrave;u CMYK m&agrave; bản in vẫn chuẩn m&agrave;u v&agrave; đẹp như hệ m&agrave;u RBG. V&agrave; ở đ&acirc;y chủ yếu ở c&aacute;ch thức xuất file in, việc lựa chọn sai dẫn tới hậu quả l&agrave; phải xuất lại file v&agrave; in lại, như vậy vừa tốn thời gian, c&ocirc;ng sức cũng như vật tư tiền bạc.</p>\r\n<h2><span style=\"color: #1642fa;\"><strong>2. C&aacute;c bước thực hiện khi xuất file AI sang File in dạng TIFF đ&uacute;ng</strong></span></h2>\r\n<p><em><strong>V&agrave; đ&acirc;y l&agrave; c&aacute;ch l&agrave;m đ&uacute;ng khi xuất file in định dạng TIFF cho m&aacute;y in Kỹ Thuật Số sử dụng <a title=\"Mực dầu Eco Solvent\" href=\"https://dailong.asia/bat-hiflex-decal/muc-dau-i3200-dx5-dx7-xp600-tx800-eco-solvent-57.html\" target=\"_blank\" rel=\"noopener\">mực m&agrave;u CMYK</a> c&oacute; sử dụng phần mềm in maintop.</strong></em></p>\r\n<p>b1: Xuất File khi chọn v&agrave;o file -&gt; export v&agrave; lựa chọn định dạng file xuất l&agrave; <strong>.Tif</strong></p>\r\n<p><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Lựa chọn định dạng file Tiff\" src=\"http://dailong.asia/public/upload/tinymce/b2%20Lua%20Chon%20Dinh%20Dang%20File%20AI%20TIFF.jpg\" alt=\"Lựa chọn định dạng file Tiff\" width=\"50%\" height=\"100%\" /></strong></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Sau khi đặt t&ecirc;n cho file, click Export sẽ hiện ra bảng chọn, v&agrave; đ&acirc;y l&agrave; bước cực k&igrave; quan trọng để c&oacute; bản in chuẩn m&agrave;u như file thiết kế.</strong></span></p>\r\n<p>b2: C&aacute;c lựa chọn khi bảng hiện hiện ra, v&agrave; c&aacute;c bạn l&agrave;m theo như y&ecirc;u cầu, cuối b&agrave;i c&oacute; h&igrave;nh ảnh cụ thể.</p>\r\n<p><strong>1: Color Model</strong>: CMYK</p>\r\n<p><strong>2: Resolution</strong>:</p>\r\n<p>- Phụ thuộc v&agrave;o k&iacute;ch thước của file nếu file l&agrave; k&iacute;ch thước thực v&iacute; dụ cần bản in 300cm x 200 cm m&agrave; file cũng l&agrave; k&iacute;ch thước đ&oacute; th&igrave; chọn l&agrave; 120 đến 250 PPI, phụ thuộc v&agrave;o k&iacute;ch thước file, file lớn th&igrave; PPI 120 hoặc 100, v&igrave; n&oacute; sẽ tạo ra file dung lượng rất lớn,</p>\r\n<p>- Trường hợp file nhỏ th&igrave; lấy số 120PPI nh&acirc;n với tỉ lệ, v&iacute; dụ file thiết kế 30cm x 20 cm m&agrave; file in l&agrave; 300cm x 200cm th&igrave; l&uacute;c đ&oacute; PPI nh&acirc;n 10 lần l&ecirc;n l&agrave; 1200 PPI, cứ &aacute;p dụng theo c&ocirc;ng thức tr&ecirc;n để lựa chọn độ ph&acirc;n giải ph&ugrave; hợp, độ ph&acirc;n giải c&agrave;ng lớn th&igrave; file in c&agrave;ng n&eacute;t.</p>\r\n<p>- PPI dao động từ 120 đến 250 hoặc 300 PPI l&agrave; phụ thuộc v&agrave;o lựa chọn chất liệu in, nếu để in bạt hiflex th&igrave; từ 120 đến 180 PPI l&agrave; hợp l&yacute;, c&ograve;n nếu với in Decal hoặc PP ch&uacute;ng ta sẽ chọn PPI từ 230 tới 300 PPI, nếu file nhỏ th&igrave; c&oacute; thể chọn 450 PPI hoặc 600 PPI t&ugrave;y thuộc v&agrave; độ n&eacute;t file xuất m&agrave; ch&uacute;ng ta mong muốn, v&agrave; ch&uacute;ng ta cũng &aacute;p dụng với gạch thứ 2 khi xuất file tr&ecirc;n phần mềm v&agrave; k&iacute;ch thước thực tế.</p>\r\n<p>- Trong b&agrave;i hướng dẫn n&agrave;y v&igrave; file thiết kế nhỏ hơn 10 lần file thực tế n&ecirc;n t&ocirc;i đ&atilde; lựa chọn l&agrave; 1200 PPI</p>\r\n<p><strong>3: Anti-aliasing</strong>: Typed Optimized (Hinted)</p>\r\n<p><strong>4: Tick chọn v&agrave;o &ocirc;</strong>: LZW Compress (mục đ&iacute;ch giảm dụng lượng file xuất)</p>\r\n<p><strong>5: Tick chọn v&agrave;o &ocirc;</strong>: Embeb ICC profile</p>\r\n<p><em><strong>Sau đ&oacute; nhấn OK v&agrave; chờ đợi phần mềm ho&agrave;n th&agrave;nh c&ocirc;ng việc, sau đ&oacute; lấy file đ&atilde; xuất đ&oacute; đưa l&ecirc;n phần mềm in maintop để in v&agrave; thưởng thức.</strong></em></p>\r\n<h2><span style=\"color: #1642fa;\"><strong>3. H&igrave;nh ảnh v&agrave; h&igrave;nh ảnh so s&aacute;nh khi xuất file lựa chọn hệ m&agrave;u kh&aacute;c nhau.</strong></span></h2>\r\n<p><span style=\"color: #000000;\"><em><span style=\"text-decoration: underline;\">H&igrave;nh ảnh khi l&agrave;m đ&uacute;ng</span></em></span></p>\r\n<p><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"AI TIFF XUẤT Đ&Uacute;NG\" src=\"http://dailong.asia/public/upload/tinymce/b2%20Lua%20Chon%20Tuy%20Chon%20AI%20TIFF.jpg\" alt=\"AI TIFF XUẤT Đ&Uacute;NG\" width=\"50%\" height=\"100%\" /></strong></p>\r\n<p><span style=\"text-decoration: underline;\"><em>C&ograve;n trường hợp ngược lại như h&igrave;nh dưới th&igrave; bản in sẽ kh&ocirc;ng đ&uacute;ng như file thiết kế</em></span></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"AI TIFF XUẤT SAI\" src=\"http://dailong.asia/public/upload/tinymce/b2-1%20Rbg%20AI%20TIFF.jpg\" alt=\"AI TIFF XUẤT SAI\" width=\"50%\" height=\"100%\" /></p>\r\n<p><em>H&igrave;nh ảnh thực tế của 2 bản in khi lựa chọn hệ m&agrave;u kh&aacute;c nhau (b&ecirc;n tr&ecirc;n in đ&uacute;ng m&agrave;u khi xuất file lựa chọn CMYK, b&ecirc;n dưới lựa chọn RBG)</em></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"So s&aacute;nh bản in xuất RBG vs CMYK\" src=\"http://dailong.asia/public/upload/tinymce/Xuat%20File%20AI%20in%20CMYK%20TIFF.jpg\" alt=\"So s&aacute;nh bản in xuất RBG vs CMYK\" width=\"50%\" height=\"100%\" /></p>\r\n<p><em>H&igrave;nh ảnh file gốc tr&ecirc;n phần mềm thiết kế AI Adobe Illustrator</em></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"File Thiết Kế AI hệ m&agrave;u RBG\" src=\"http://dailong.asia/public/upload/tinymce/File%20AI%20g%E1%BB%91c%20AI%20TIFF.png\" alt=\"File Thiết Kế AI hệ m&agrave;u RBG\" width=\"050%\" height=\"100%\" /></p>\r\n<p><em><strong>B&agrave;i viết tr&ecirc;n l&agrave; to&agrave;n bộ nội dung hướng dẫn thợ in khi xuất file in từ AI sang file TIFF đ&uacute;ng m&agrave;u với file thiết kế, b&agrave;i viết n&agrave;y dựa tr&ecirc;n kinh nghiệm sử dụng thực tế.</strong></em></p>\r\n<p><em><strong>Tranfer AI File into Tiff file for printing using maintop application right way, right color</strong></em></p>\r\n<p><em><strong>Thank for reading!</strong></em></p>', NULL, NULL, NULL, 114, '1', 'Hướng dẫn xuất file AI adobe illustrator sang file in dạng Tif chuẩn màu in CMYK trên máy in kỹ thuật số sử dụng phần mềm maintop, cách khắc phục khi màu in không giống file in AI', 'Xuất file in AI sang Tiff chuẩn CMYK, hướng dẫn xuất file AI sang Tiff chuẩn màu, file AI xuất in không đúng màu trên máy in kỹ thuật số, khắc phục màu in file AI không giống bản in thực tế, Adobe Illustrator into tiff using maintop', '2024-12-23 19:32:33', '2024-03-02 23:04:47', '2024-03-02 23:15:03', NULL);
