load_path($name))) {</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; if (isset($uploaded_bytes)) {</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; if ($uploaded_bytes === $this-&gt;get_file_size(</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $this-&gt;get_upload_path($name)</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; )) {</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;break;</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $name = $this-&gt;upcount_name($name);</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp; }</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp; return $name;</code></p>\r\n<p><code>}</code></p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>Thay đổi chỗ n&agrave;y th&igrave; th&ecirc;m điều kiện trong d&ograve;ng code điểm kiểm tra (more info: add more condition to check)</em></strong></p>\r\n<p><code>$uploaded_bytes = $this-&gt;fix_integer_overflow((int)$content_range[1]);</code></p>\r\n<p><em>Đổi th&agrave;nh (change into)</em></p>\r\n<p><code>if (isset($content_range[1])) {</code></p>\r\n<p><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $uploaded_bytes = $this-&gt;fix_integer_overflow((int)$content_range[1]);</code></p>\r\n<p><code>}</code></p>\r\n<p>&nbsp;</p>\r\n<p>And</p>\r\n<p><code>if ($uploaded_bytes === $this-&gt;get_file_size($this-&gt;get_upload_path($name))) {</code></p>\r\n<p><code>break;</code></p>\r\n<p><code>}</code></p>\r\n<p><em>Đổi th&agrave;nh (change into)</em></p>\r\n<p><code>if (isset($uploaded_bytes)) {</code></p>\r\n<p><code>&nbsp; if ($uploaded_bytes === $this-&gt;get_file_size($this-&gt;get_upload_path($name))) {</code></p>\r\n<p><code>&n