INSERT INTO `post` (`id`, `post_cate_id`, `post_cate_name`, `post_cate_slug`, `post_title`, `post_alias`, `post_slug`, `post_intro`, `post_image`, `post_status`, `post_finish`, `post_featured`, `post_content`, `post_content2`, `post_price`, `post_sale`, `post_view`, `post_show`, `post_meta_desc`, `post_meta_key`, `time_view_newest`, `created_at`, `updated_at`, `deleted_at`) VALUES
(77, 14, 'Blog', 'blog', 'Lễ Phật Đản và Tổng Hợp hơn 6 File Vector Mừng Đại Lễ Phật Đản Vesak Celebrate Buddha\'s Birthday Google Drive Short Link', 'Lễ Phật Đản và Tổng Hợp hơn 6 File Vector Mừng Đại Lễ Phật Đản Celebrate Buddha\'s Birthday Google Drive Short Link', 'le-phat-dan-va-tong-hop-hon-6-file-vector-mung-dai-le-phat-dan-celebrate-buddha-s-birthday-google-drive-short-link', 'Lễ Phật Đản (Celebrate Buddha\'s Birthday) là ngày lễ trọng đại được tổ chức hàng năm vào ngày rằm tháng tư để kỷ niệm ngày Đức Phật ra đời', 'tong hop file thiet ke vector le phat dan.jpg', 'normal', NULL, 0, '<p><strong>Lễ Phật Đản (Celebrate Buddha\'s Birthday) l&agrave; ng&agrave;y lễ trọng đại được tổ chức h&agrave;ng năm v&agrave;o ng&agrave;y rằm th&aacute;ng tư để kỷ niệm ng&agrave;y Đức Phật ra đời</strong></p>\r\n<p>Ng&agrave;y Phật Đản l&agrave; một trong ba ng&agrave;y lễ lớn trong năm của đạo Phật (Phật Đản, Vu lan, Th&agrave;nh đạo). Trước năm 1959, c&aacute;c nước Đ&ocirc;ng &Aacute; thường tổ chức ng&agrave;y lễ Phật Đản v&agrave;o ng&agrave;y 8/4 &acirc;m lịch. Nhưng tại Đại hội Phật gi&aacute;o thế giới lần đầu ti&ecirc;n, tại Colombo (T&iacute;ch Lan) được tổ chức từ 25/5 đến 8/6/1950, 26 nước l&agrave; th&agrave;nh vi&ecirc;n thống nhất lấy ng&agrave;y Phật Đản quốc tế l&agrave;&nbsp;ng&agrave;y rằm th&aacute;ng tư &acirc;m lịch h&agrave;ng năm (15/4).</p>\r\n<p>Từ năm 1999, ng&agrave;y <a title=\"Lễ Phật Đản (Celebrate Buddha\'s Birthday)\" href=\"https://dailong.asia/bo-suu-tap-topic/le-phat-dan\" target=\"_blank\" rel=\"noopener\">Lễ Phật Đản (Celebrate Buddha\'s Birthday)</a> 15/4 (&acirc;m lịch) đ&atilde; được Li&ecirc;n Hiệp Quốc c&ocirc;ng nhận l&agrave; ng&agrave;y lễ hội văn h&oacute;a t&acirc;m linh thế giới. Lễ Phật Đản l&agrave; một trong ba lễ cấu th&agrave;nh Lễ Tam hợp m&agrave; Li&ecirc;n Hiệp Quốc gọi l&agrave; <strong>Vesak </strong>(lễ Phật Đản sinh, lễ Phật th&agrave;nh đạo v&agrave; lễ Phật nhập Niết b&agrave;n).</p>\r\n<p>Lễ Phật Đản (Celebrate Buddha\'s Birthday) được tổ chức h&agrave;ng năm, v&agrave;o ng&agrave;y rằm th&aacute;ng tư, để kỷ niệm ng&agrave;y Đức Phật ra đời. Đức Phật Th&iacute;ch Ca M&acirc;u Ni xuất th&acirc;n l&agrave; Th&aacute;i tử Tất Đạt Đa, d&ograve;ng họ Cồ Đ&agrave;m, vương tộc Th&iacute;ch Ca. Ng&agrave;i được cho l&agrave; sinh v&agrave;o ng&agrave;y rằm th&aacute;ng tư &acirc;m lịch năm 624 trước T&acirc;y lịch (theo l&yacute; giải của ph&aacute;i Nam t&ocirc;ng), m&ugrave;ng 8/4 &acirc;m lịch (theo l&yacute; giải của ph&aacute;i theo Bắc t&ocirc;ng) tại vườn L&acirc;m Tỳ Ni - nơi nằm giữa Ca Tỳ La Vệ v&agrave; Devadaha ở Nepal.</p>\r\n<p>V&agrave;o ng&agrave;y lễ, Phật tử thường vinh danh Tam bảo: Phật, Ph&aacute;p, Tăng (qua c&aacute;c h&igrave;nh thức như d&acirc;ng c&uacute;ng, tặng hoa, đến nghe thuyết giảng), v&agrave; thực h&agrave;nh ăn chay v&agrave; giữ Ngũ giới, thực h&agrave;nh bố th&iacute; v&agrave; l&agrave;m việc từ thiện, tặng qu&agrave;, tiền cho những người yếu k&eacute;m trong cộng đồng.</p>\r\n<p><em>Tr&ecirc;n đ&acirc;y l&agrave; th&ocirc;ng tin về ng&agrave;y <a title=\"Lễ Phạt Đản\" href=\"https://dailong.asia/bo-suu-tap-topic/le-phat-dan\" target=\"_blank\" rel=\"noopener\">Lễ Phạt Đản</a> m&agrave; t&aacute;c giả sưu tầm nguồn từ website: <a href=\"http://bantongiao.snv.kontum.gov.vn/nghien-cuu-ve-tin-nguong,-ton-giao/TIM-HIEU-VE-Y-NGHIA-CUA-DAI-LE-PHAT-DAN-340\" target=\"_blank\" rel=\"noopener\">http://bantongiao.snv.kontum.gov.vn/nghien-cuu-ve-tin-nguong,-ton-giao/TIM-HIEU-VE-Y-NGHIA-CUA-DAI-LE-PHAT-DAN-340</a></em></p>\r\n<p><em><span style=\"text-decoration: underline;\">Sau đ&acirc;y l&agrave; tổng hợp c&aacute;c file thiết kế cho ng&agrave;y Lễ Phật Đản cho đơn vị in ấn thi c&ocirc;ng thiết kế cho ng&agrave;y lễ n&agrave;y.</span></em></p>\r\n<p><strong>Mẫu Thiết Kế Vector Lễ Phật Đản số 01</strong>: L&agrave; mẫu trang tr&iacute; được thiết kế cho tổ chức ngo&agrave;i trời với s&acirc;n khấu h&igrave;nh c&aacute;nh sen. Chi tiết xem h&igrave;