(82, 14, 'Blog', 'blog', 'LCK Summer Season 2024 - LCK Mùa Hè 2024', 'LCK Summer Season 2024 - LCK Mùa Hè 2024', 'lck-summer-season-2024-lck-mua-he-2024', 'Tóm tắt kết quả toàn bộ giải LCK Mùa hè 2024', 'LCK 2024 Summer Season.png', 'normal', 'finish', 0, '<p><em><span style=\"color: #000000; font-size: 18px;\"><strong>League of Legends Champions Korea, trước đ&acirc;y được biết đến với t&ecirc;n Ongamenet LCK v&agrave; được tổ chức bởi Ongamenet, l&agrave; đấu trường cao cấp nhất của bộ m&ocirc;n thể thao điện tử nội dung Li&ecirc;n Minh Huyền Thoại tại H&agrave;n Quốc. C&aacute;c trận đấu chung kết LCK được tổ chức tại Yongshan e-Sports ở Yongsan-gu, Seoul.</strong></span></em></p>\r\n<p><span style=\"font-size: 20px;\">Cấp giải đấu:&nbsp;<strong><span class=\"LrzXr kno-fv wHYlTd z8gr9e\">Khu vực</span></strong></span></p>\r\n<p><span class=\"w8qArf\" style=\"font-size: 20px;\">C&uacute;p quốc nội:&nbsp;</span><strong><span class=\"LrzXr kno-fv wHYlTd z8gr9e\" style=\"font-size: 20px;\">M&ugrave;a Xu&acirc;n; M&ugrave;a H&egrave;</span></strong></p>\r\n<p><span class=\"w8qArf\" style=\"font-size: 20px;\">Đương kim v&ocirc; địch Xu&acirc;n 2024: </span><strong><span class=\"LrzXr kno-fv wHYlTd z8gr9e\" style=\"font-size: 20px;\">Gen.G; (lần thứ 5)</span></strong></p>\r\n<p><span class=\"w8qArf\" style=\"font-size: 20px;\">Giải thứ cấp:&nbsp;</span><strong><span class=\"LrzXr kno-fv wHYlTd z8gr9e\" style=\"font-size: 20px;\">LCK Challengers League</span></strong></p>\r\n<p><span class=\"w8qArf\" style=\"font-size: 20px;\">Khu vực:&nbsp;</span><strong><span class=\"LrzXr kno-fv wHYlTd z8gr9e\" style=\"font-size: 20px;\">H&agrave;n Quốc</span></strong></p>\r\n<p><span class=\"w8qArf\" style=\"font-size: 20px;\">Số đội:&nbsp;</span><strong><span class=\"LrzXr kno-fv wHYlTd z8gr9e\" style=\"font-size: 20px;\">10</span></strong></p>\r\n<p><span class=\"w8qArf\" style=\"font-size: 20px;\">Th&agrave;nh lập:&nbsp;</span><strong><span class=\"LrzXr kno-fv wHYlTd z8gr9e\" sty