le=\"color: #1a06f9;\"><strong>DRX:</strong></span> Top <strong>Frog</strong> - Jungle <strong>Sponge </strong>-<strong> </strong>Mid <strong>Kyeahoo </strong>-<strong> </strong>Bot <strong>Teedy </strong>-<strong> </strong>Support <strong>Pieata</strong></p>\r\n<p><span style=\"color: #1a06f9;\"><strong>HLE:</strong></span> Top <strong>Doran</strong>&nbsp;- Jungle <strong>Peanut </strong>-<strong> </strong>Mid <strong>Zeka </strong>-<strong> </strong>Bot <strong>Viper </strong>-<strong> </strong>Support <strong>Delight</strong></p>\r\n<p><span style=\"color: #1a06f9;\"><strong>BRO:</strong></span> Top <strong>Morgan</strong>&nbsp;- Jungle <strong>YoungJae </strong>-<strong> </strong>Mid <strong>Karis </strong>-<strong> </strong>Bot <strong>Envyy </strong>-<strong> </strong>Support <strong>Pollu</strong></p>\r\n<p><span style=\"color: #1a06f9;\"><strong>KT:</strong></span> Top <strong>PerfecT</strong>&nbsp;- Jungle <strong>Pyosik </strong>-<strong> </strong>Mid <strong>Bdd </strong>-<strong> </strong>Bot <strong>Deft </strong>-<strong> </strong>Support <strong>BeryL</strong></p>\r\n<p><strong><span style=\"color: #1a06f9;\">DK:</span></strong> Top <strong>Kingen</strong>, Jungle <strong>Lucid</strong>, Mid <strong>ShowMaker</strong>, Bot <strong>Aiming</strong>, Support <strong>Kellin</strong></p>\r\n<p><strong><span style=\"color: #1a06f9;\">KDF:</span></strong> Top <strong>DuDu</strong> - Jungle <strong>Cuzz </strong>-<strong> </strong>Mid <strong>BullDog </strong>-<strong> </strong>Bot <strong>Leaper </strong>-<strong> </strong>Support <strong>Andil</strong></p>\r\n<p><span style=\"color: #1a06f9;\"><strong>FOX:</strong></span> Top <strong>Clear</strong> - Jungle <strong>Raptor </strong>-<strong> </strong>Mid <strong>Clozer </strong>-<strong> </strong>Bot <strong>Hena </strong>-<strong> </strong>Support <strong>Execute</strong></p>', NULL, NULL, 21, '1', 'Tóm tắt kết quả toàn bộ giải LCK Mùa hè 2024 LCK Summer Season 2024', 'Tóm tắt kết quả toàn bộ giải LCK Mùa h