INSERT INTO `post` (`id`, `post_cate_id`, `post_cate_name`, `post_cate_slug`, `post_title`, `post_alias`, `post_slug`, `post_intro`, `post_image`, `post_status`, `post_finish`, `post_featured`, `post_content`, `post_content2`, `post_price`, `post_sale`, `post_view`, `post_show`, `post_meta_desc`, `post_meta_key`, `time_view_newest`, `created_at`, `updated_at`, `deleted_at`) VALUES
(83, 14, 'Blog', 'blog', 'Hướng dẫn khắc phục lỗi Corel Draw không tắt được', 'Hướng dẫn khắc phục lỗi Corel Draw không tắt được', 'huong-dan-khac-phuc-loi-corel-draw-khong-tat-duoc', 'Bài viết hướng dẫn tắt corel báo lỗi không thể tắt ứng dụng', 'Corel Draw/corel error cannot close app 03 - thumb.jpg', 'normal', 'finish', 0, '<p><em><strong>Giới thiệu về phầm mềm đồ họa corelDraw:</strong> l&agrave; phần mềm thiết kế đa dụng b&ecirc;n cạnh phần mềm kh&aacute;c nổi tiếng của Adobe AI (Adobe Ilustrator), đ&acirc;y l&agrave; phần mềm thiết kế dạng vector, khi zoom vật thể vector l&ecirc;n th&igrave; kh&ocirc;ng c&oacute; hiện tượng vỡ h&igrave;nh như Photoshop v&igrave; n&oacute; phụ thuộc v&agrave;o chất lượng ảnh.</em></p>\r\n<p>Sử dụng phần mềm corel kh&aacute; đơn giản, v&igrave; giao diện trực quan, thao t&aacute;c đơn giản, k&eacute;o thả v&agrave; v&ugrave;ng l&agrave;m việc lớn.</p>\r\n<p>Corel được ưa chuộng cho đơn vị thiết kế quảng c&aacute;o v&igrave; t&iacute;nh đa dụng, dung lượng l&agrave;m file nhẹ.</p>\r\n<p><em><strong>Nhược điểm:</strong> với file corel draw đời mới th&igrave; phải n&acirc;ng cấp phi&ecirc;n bản c&agrave;i đặt ngang bằng hoặc hơn với file cdr được tạo ra, ex: file cdr được l&agrave;m tr&ecirc;n corel draw x7 v&agrave; lưu ở thiết bị cũng l&agrave; version 17 th&igrave; để mở file đ&oacute; ch&uacute;ng ta c&agrave;i version corel l&agrave; x7 hoặc cao hơn như x8 x9 hoặc v25 mới nhất, ngược lại bạn sẽ kh&ocirc;ng xem mở được file với phi&ecirc;n bản x6 hoặc thấp hơn.</em></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Với lỗi kh&ocirc;ng tắt được phầm mềm corel, th&igrave; th&ocirc;ng b&aacute;o lỗi sẽ hiện l&ecirc;n l&agrave;:</strong></span></p>\r\n<p><em>\"Some of the documents could not be closed, because some tasks that were being performed in the background have failed. Check the status bar of each opened document to see which task has failed.\"</em></p>\r\n<p><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Some of the documents could not be closed\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/corel%20error%20cannot%20close%20app%2003.jpg\" alt=\"Some of the documents could not be closed\" width=\"80%\" height=\"100%\" /></em></p>\r\n<p><strong>Tạm dịch:</strong> một v&agrave;i t&agrave;i liệu (tab) kh&ocirc;ng thể tắt, v&igrave; một v&agrave;i tiến tr&igrave;nh đang được thực hiện dưới nền (background) bị lỗi, kiểm tra t&igrave;nh trạng ở thanh c&ocirc;ng cụ m&agrave; tab đ&oacute; đang mở m&agrave; bị lỗi.</p>\r\n<p><strong>T&oacute;m lại:</strong>&nbsp;tab l&agrave;m việc bị lỗi, kiểm tra trạng th&aacute;i dưới thanh c&ocirc;ng cụ để xem chi tiết.</p>\r\n<p>Với lỗi như vậy c&oacute; thể một số người sẽ kh&ocirc;ng biết lỗi như thế n&agrave;o v&agrave; c&aacute;ch khắc phục như thế n&agrave;o. V&igrave; kh&ocirc;ng biết chỗ vị tr&iacute; b&aacute;o lỗi ở đ&acirc;u.</p>\r\n<p>Lỗi n&agrave;y với những người kh&ocirc;ng th&agrave;nh thạo về c&ocirc;ng nghệ hoặc m&aacute;y t&iacute;nh c&oacute; thể sử dụng phương &aacute;n l&agrave; tắt m&aacute;y t&iacute;nh khởi động lại để x&oacute;a lỗi, điều n&agrave;y kh&aacute; phiền phức</p>\r\n<p><strong>Sau đ&acirc;y l&agrave; c&aacute;ch khắc phục lỗi như sau:</strong></p>\r\n<p><em><strong>B1 T&igrave;m vị tr&iacute; thanh status bar background:</strong></em> Vị tr&iacute; m&agrave; th&ocirc;ng b&aacute;o t&aacute;c vụ đang thực hiện tr&ecirc;n phần mềm nằm ở vị trị g&oacute;c phải dưới c&ugrave;ng của phần mềm, chi tiết tại ảnh</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"tasks that were being performed in the background \" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/Background%20Status%20Bar.jpg\" alt=\"tasks that were being performed in the background \" width=\"50%\" height=\"100%\" /></p>\r\n<p><strong>Bước 2:</strong> kiểm tra trạng th&aacute;i l&agrave;m việc của phần mềm, l&agrave;m việc b&igrave;nh thường hay đang bị lỗi</p>\r\n<p>2.1 Thanh c&ocirc;ng cụ thể hiện phần mềm l&agrave;m việc b&igrave;nh thường</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Thanh c&ocirc;ng vụ l&agrave;m việc b&igrave;nh thường\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/Working%20Nomal%202.jpg\" alt=\"Thanh c&ocirc;ng vụ l&agrave;m việc b&igrave;nh thường\" width=\"50%\" height=\"100%\" /></p>\r\n<p>2.2 Thanh c&ocirc;ng cụ thể hiện trạng th&aacute;i l&agrave;m việc bị lỗi</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Thanh c&ocirc;ng cụ th&ocirc;ng b&aacute;o trạng th&aacute;i l&agrave;m việc bị lỗi tr&ecirc;n corel draw\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/Error%20Corel%20Draw.jpg\" alt=\"Thanh c&ocirc;ng cụ th&ocirc;ng b&aacute;o trạng th&aacute;i l&agrave;m việc bị lỗi tr&ecirc;n corel draw\" width=\"50%\" height=\"100%\" /></p>\r\n<p><em><strong>B3 T&igrave;m vị tr&iacute; b&aacute;o lỗi: </strong></em>với lỗi tr&ecirc;n th&igrave; việc đầu ti&ecirc;n l&agrave; t&igrave;m được &ldquo;Check the status bar&rdquo; ở đ&acirc;u, n&oacute; nằm ở dưới c&ugrave;ng b&ecirc;n phải m&agrave;n h&igrave;nh của phần mềm v&agrave; bạn click v&agrave;o sẽ hiện th&ocirc;ng b&aacute;o như h&igrave;nh, đ&oacute; l&agrave; thanh trạng th&aacute;i l&agrave;m việc như lưu file, xuất file sang định dạng kh&aacute;c..., tiếp đến để x&oacute;a lỗi c&aacute;c bạn click v&agrave;o chữ \"<span style=\"color: #3598db;\">More Info</span>\".</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Bar status error\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/Error%20Corel%20Draw.jpg\" alt=\"Bar status error\" width=\"50%\" height=\"100%\" /></p>\r\n<p><em><strong>B4: Tắt hoặc dừng c&ocirc;ng việc đang l&agrave;m của phầm mềm khi xảy ra lỗi</strong></em></p>\r\n<p>Th&ocirc;ng thường nếu phần mềm đang l&agrave;m việc l&agrave; c&ocirc;ng việc lưu file hay xuất file đang diễn ra th&igrave; c&oacute; thể c&oacute; hoặc kh&ocirc;ng tắt, chờ 1 thời gian khi phần mềm l&agrave;m việc xong th&igrave; tắt l&agrave; được, nhưng với trường hợp phầm mềm bị lỗi v&igrave; nguy&ecirc;n nh&acirc;n kh&aacute;c th&igrave; buộc phải x&oacute;a t&aacute;c vụ đang thực hiện lại để tắt phần mềm.</p>\r\n<p>Việc tắt t&aacute;c vụ lỗi sẽ thực hiện theo bước sau: click v&agrave;o thanh trạng th&aacute;i -&gt; click v&agrave;o chữ <strong>More Info</strong> -&gt; Click v&agrave;o <strong>OK</strong> -&gt; <strong>Finish</strong></p>\r\n<p><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"click more info\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/Error%20Corel%20Draw.jpg\" alt=\"click more info\" width=\"50%\" height=\"100%\" /></strong></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"tắt lỗi sau khi click v&agrave;o more info\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/04.jpg\" alt=\"tắt lỗi sau khi click v&agrave;o more info\" width=\"50%\" height=\"100%\" /></p>\r\n<p><em><strong>Sau đ&oacute; bạn tắt chương tr&igrave;nh như b&igrave;nh thường.</strong></em></p>', '<p>Việc tắt lỗi kh&aacute; đơn giản, một v&agrave;i trường hợp tắt hoặc dừng t&aacute;c vụ c&oacute; thể phải chờ 1-3 ph&uacute;t mới ho&agrave;n th&agrave;nh</p>\r\n<p><em><strong>Vậy b&agrave;i viết đ&atilde; hướng dẫn c&aacute;c bạn khắc phục lỗi tr&ecirc;n phần mềm Corel Draw.</strong></em></p>', NULL, NULL, 33, '1', 'Kiểm tra tình trạng tác vụ đang chạy nền trong corel để khắc phục lỗi không tắt được phần mềm corel draw x7 và mọi phiên bản khác với lỗi Some of the documents could not be closed, because some tasks that were being performed in the background have failed', 'corel bị lỗi không tắt được, Some of the documents could not be closed, because some tasks that were being performed in the background have failed. Check the status bar of each opened document to see which task has failed, khắc phục lỗi khi corel bị lỗi k', '2024-12-16 09:25:37', '2024-06-23 17:16:39', '2024-06-23 17:16:39', NULL),
(84, 14, 'Blog', 'blog', 'Background Phông Nền Đám Cưới Báo Hỷ Tổng Hợp - Wedding Announcement Summary', 'Background Phông Nền Đám Cưới Báo Hỷ Tổng Hợp - Wedding Announcement Summary', 'background-phong-nen-dam-cuoi-bao-hy-tong-hop-wedding-announcement-summary', 'Nơi tổng hợp nhiều và chi tiết phông nền đám cưới link google drive short', 'tong hop cuoi.jpg', 'normal', 'updating', 0, '<p>Nơi tổng hợp nhiều v&agrave; chi tiết ph&ocirc;ng nền đ&aacute;m cưới link google drive short</p>\r\n<p>B&agrave;i viết sẽ được tổng hợp thường xuy&ecirc;n khi c&oacute; mẫu mới, ph&ugrave; hợp với mọi người, m&agrave;u sắc ph&ugrave; hợp với phong thủy tuổi t&aacute;c, đa dạng trong thiết kế, bắt mắt</p>\r\n<p>Chi tiết từng ph&ocirc;ng nền b&ecirc;n dưới</p>\r\n<p><em><strong>Mẫu 01: Ph&ocirc;ng nền đ&aacute;m cưới xanh lam ngọc, m&agrave;u nhẹ nh&agrave;ng dịu mắt</strong></em></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Ph&ocirc;ng nền đ&aacute;m cưới 01 Organize A Wedding\" src=\"https://dailong.asia/public/upload/tinymce/gallery_asset/background-scenery-phong-nen-to-chuc-dam-cuoi-01-organize-a-wedding-google-drive-short-5yjA0I.jpg\" alt=\"Ph&ocirc;ng nền đ&aacute;m cưới 01 Organize A Wedding\" width=\"30%\" height=\"100%\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 28px;\"><strong>Link chi tiết <a title=\"Ph&ocirc;ng nền đ&aacute;m cưới 01\" href=\"https://dailong.asia/bo-suu-tap/background-scenery-phong-nen-to-chuc-dam-cuoi-01-organize-a-wedding-google-drive-short-333.html\" target=\"_blank\" rel=\"noopener\">tại đ&acirc;y</a></strong></span></p>\r\n<p>&nbsp;</p>', '<p><em><strong>Mẫu 02: M&agrave;u sắc xanh đậm với 2 con hạc v&agrave; trang tr&iacute; nhưng c&aacute;nh hoa xung quanh</strong></em></p>\r\n<p><em><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Background Scenery Ph&ocirc;ng Nền Tổ Chức Đ&aacute;m Cưới Xanh Đậm v&agrave; Con Hạc 02 - Dark Green Wedding Backdrop and Flamingo - Google Drive Short\" src=\"https://dailong.asia/public/upload/tinymce/gallery_asset/background-scenery-phong-nen-to-chuc-dam-cuoi-xanh-dam-va-con-hac-02-dark-green-wedding-backdrop-and-crane-google-drive-short-GxaXfO.jpg\" alt=\"Background Scenery Ph&ocirc;ng Nền Tổ Chức Đ&aacute;m Cưới Xanh Đậm v&agrave; Con Hạc 02 - Dark Green Wedding Backdrop and Flamingo - Google Drive Short\" width=\"30%\" height=\"100%\" /></strong></em></p>\r\n<p style=\"text-align: center;\"><em><strong><span style=\"font-size: 28px;\">Link chi tiết <a title=\"Ph&ocirc;ng nền đ&aacute;m cưới 02\" href=\"https://dailong.asia/bo-suu-tap/background-scenery-phong-nen-to-chuc-dam-cuoi-xanh-dam-va-con-hac-02-dark-green-wedding-backdrop-and-flamingo-google-drive-short-395.html\" target=\"_blank\" rel=\"noopener\">tại đ&acirc;y</a></span></strong></em></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 24px;\"><em>Số mẫu đ&atilde; tổng hợp: <strong><span style=\"color: #e03e2d;\">02</span></strong></em></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 24px; color: #236fa1;\"><em><strong>B&agrave;i viết được tổng hợp v&agrave; update hằng ng&agrave;y, c&aacute;m ơn c&aacute;c bạn đ&atilde; xem b&agrave;i viết v&agrave; gh&eacute; thăm website: dailong.asia</strong></em></span></p>', NULL, NULL, 82, '1', 'Background Phông Nền Đám Cưới Báo Hỷ Tổng Hợp - Wedding Announcement Summary, Nơi tổng hợp nhiều và chi tiết phông nền đám cưới link google drive short', 'Background Phông Nền Đám Cưới Báo Hỷ, Wedding Announcement Summary, Nơi tổng hợp nhiều và chi tiết phông nền đám cưới, link google drive tốc độ cao, tổng hợp chi tiết backdrop đám cưới đa dạng', '2024-12-29 18:37:42', '2024-06-24 14:23:29', '2024-07-01 06:13:23', NULL),
(85, 14, 'Blog', 'blog', 'Instructions to fix (resolve) the error that cannot be close', 'Instructions to fix resolve the error that cannot be close', 'instructions-to-fix-resolve-the-error-that-cannot-be-close', 'Instructions to fix the error that cannot be close, detailed instructions in the article', 'Corel Draw/corel error cannot close app 03 - thumb.jpg', 'normal', 'finish', 0, '<p><em>Introduction to CorelDraw graphics software: is a multi-purpose design software besides other famous software of Adobe AI (Adobe Ilustrator), this is a vector design software, when zooming in on a vector object, it does not appear. The image is broken like Photoshop because it depends on the image quality.</em></p>\r\n<p>Using Corel software is quite simple, because of the intuitive interface, simple operations, drag and drop and large working area.</p>\r\n<p>Corel is popular for advertising design units because of its versatility and light file capacity.</p>\r\n<p><strong>Disadvantage:</strong> <em>with the new Corel Draw file, you must upgrade the installation version to be equal or better than the created cdr file, ex: the cdr file is made on Corel Draw x7 and saved on a device that is also version 17 to open. For that file, we install Corel version x7 or higher like the latest x8 x9 or v25, otherwise you will not be able to open the file with version x6 or lower.</em></p>\r\n<p>With the error of not being able to turn off Corel software, the error message will appear as:</p>\r\n<p>\"Some of the documents could not be closed, because some tasks that were being performed in the background have failed. Check the status bar of each opened document to see which task has failed.\"</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"fix errors on Corel Draw software.\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/corel%20error%20cannot%20close%20app%2003%20-%20thumb.jpg\" alt=\"fix errors on Corel Draw software.\" width=\"60%\" height=\"100%\" /></p>\r\n<p>Roughly translated: some documents (tabs) cannot be closed, because some processes being performed in the background are corrupted, checking the status of the toolbar where that tab is open is corrupted.</p>\r\n<p>In short: the working tab is broken, check the status under the toolbar to see details.</p>\r\n<p>With such an error, some people may not know what the error is and how to fix it. Because I don\'t know where the error message is.</p>\r\n<p>For those who are not proficient in technology or computers, this error can be turned off and restarted to clear the error, which is quite annoying.</p>\r\n<p>Here\'s how to fix the error:</p>\r\n<p><strong>Step 1:</strong> Find the location of the status bar background: The location where the task notification is being performed on the software is in the bottom right corner of the software, details in the picture</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"fix errors on Corel Draw software cannot close\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/Background%20Status%20Bar.jpg\" alt=\"fix errors on Corel Draw software cannot close\" width=\"60%\" height=\"100%\" /></p>\r\n<p><strong>Step 2:</strong> check the working status of the software, is it working normally or is there an error</p>\r\n<p><em><strong>2.1 The toolbar shows the software working normally</strong></em></p>\r\n<p><em><strong><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"corel draw working normal\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/Working%20Nomal%202.jpg\" alt=\"corel draw working normal\" width=\"60%\" height=\"100%\" /></strong></em></p>\r\n<p><strong><em>2.2 Toolbar shows error working status</em></strong></p>\r\n<p><strong><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"CorelDraw working wrong\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/Error%20Corel%20Draw.jpg\" alt=\"CorelDraw working wrong\" width=\"60%\" height=\"100%\" /></em></strong></p>\r\n<p><strong>Step 3</strong>: Find the location of the error message: with the above error, the first thing is to find where \"Check the status bar\" is, it is at the bottom right of the software screen and if you click on it, the message as shown will appear. is the status bar for working such as saving files, exporting files to other formats..., next to clear errors, click on the word \"<span style=\"color: #3598db;\"><strong>More Info</strong></span>\".</p>\r\n<p><strong><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"CorelDraw working wrong\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/Error%20Corel%20Draw.jpg\" alt=\"CorelDraw working wrong\" width=\"60%\" height=\"100%\" /></em></strong></p>\r\n<p><strong>Step 4</strong>: Turn off or stop the software\'s work in progress when an error occurs</p>\r\n<p>Normally, if the software is working, saving files or exporting files in progress, it may or may not be turned off. Wait a while for the software to finish working, then turn it off, but in the case of software errors. For other reasons, you must delete the task in progress to turn off the software.</p>\r\n<p>Turning off the error task will follow these steps: click on the status bar -&gt; click on the word More Info -&gt; Click on <strong>OK -&gt; Finish</strong></p>\r\n<p><strong><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"CorelDraw working wrong\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/Error%20Corel%20Draw.jpg\" alt=\"CorelDraw working wrong\" width=\"60%\" height=\"100%\" /></em></strong></p>\r\n<p style=\"text-align: center;\"><strong><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"tắt lỗi sau khi click v&agrave;o more info\" src=\"https://dailong.asia/public/upload/tinymce/Corel%20Draw/04.jpg\" alt=\"tắt lỗi sau khi click v&agrave;o more info\" width=\"60%\" height=\"100%\" /></em></strong></p>\r\n<p><em>Then you turn off the program as usual.</em></p>', '<p>Turning off the error is quite simple. In some cases, turning off or stopping the task may take 1-3 minutes to complete.</p>\r\n<p><strong>So this article has guided you to fix errors on Corel Draw software.</strong></p>', NULL, NULL, 22, '1', 'Check the status of tasks running in the background in Corel to fix the error of not being able to turn off Corel Draw x7 software and all other versions with the error Some of the documents could not be closed, because some tasks that were being performe', 'Corel error cannot be shut down, Some documents cannot be closed because some tasks being performed in the background have failed. Check the status bar of each opened document to see which task failed, fix Corel error', '2024-12-29 14:19:51', '2024-07-01 06:25:10', '2024-07-01 06:25:10', NULL);
