 #4 vs BLG LPL #1 Final Game World Championship 2024 LOL\" width=\"100%\" height=\"100%\" /></em></span></strong></span></p>\r\n<h2 id=\"mcetoc_1i99goic6m\"><span style=\"color: #843fa1; font-size: 28px;\"><strong>Semifinal 02</strong></span></h2>\r\n<h2><span style=\"color: #843fa1; font-size: 18px;\"><strong><span style=\"color: #34495e;\">Match 01<em> BO5: T1 (LCK #4) 3 - GEN (LCK #2) 1 - Date: 27.10.2024 =&gt; <span style=\"color: #e03e2d;\">&nbsp;T1 <span style=\"color: #34495e;\"><span style=\"color: #e03e2d;\">goes</span></span> to Grand Final</span></em></span></strong></span></h2>\r\n<p><span style=\"color: #843fa1; font-size: 18px;\"><strong><span style=\"color: #34495e;\"><em><span style=\"color: #e03e2d;\"><img title=\"T1 vs Gen LOL Semifinal CKTG 2024\" src=\"https://dailong.asia/public/upload/tinymce/LOL%20World%20Championship/T1%20vs%20GEN%20LOL.jpg\" alt=\"T1 vs Gen LOL Semifinal CKTG 2024\" width=\"100%\" height=\"100%\" /></span></em></span></strong></span></p>\r\n<p><span style=\"text-decoration: underline; color: #050bf5;\"><strong>Game 01:</strong></span> T1 <strong>1</strong> - GEN <strong>0</strong> (Kill <strong>13</strong> - <strong>12</strong>&nbsp;in <em>31\'-27s Gold 58.9K - 54.2K</em>)</p>\r\n<p><em><strong>First Blood (Chiến C&ocirc;ng Đầu): <span style=\"color: #e03e2d;\">Noctune (Weiwei - LNG) 03\':08s</span></strong></em></p>\r\n<p><em><strong>First Turret (Trụ Đầu): <span style=\"color: #3598db;\">Renekton - LNG 15:05s;</span></strong></em></p>\r\n<p><em><strong>First Chemtech Drake (Rồng Đầu): <span style=\"color: #3598db;\">Skarner WBG 10:01s;</span></strong></em></p>\r\n<p><em><strong>Voidgrubs (S&acirc;u Hư Kh&ocirc;ng): WBG - 1: LNG - 2;</strong></em></p>\r\n<p><em><strong>Soul Drake: ;</strong></em></p>\r\n<table style=\"border-collapse: collapse; width: 99.9772%; height: 123.923px; border-style: double; margin-left: auto; margin-right: auto;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 25.1847px;\">\r\n<td style=\"width: