L.png\" alt=\"GAM LOL Team VCS #1\" width=\"20%\" height=\"100%\" /></p>\r\n<p><span style=\"color: #e03e2d;\"><strong>Vikings</strong></span> (Vikings Esport - VCS #2): Mid - <strong>Kati</strong>, Jungle - <strong>Gury</strong>, Top - <strong>Nanaue</strong>, Ad - <strong>Shogun</strong>, SP - <strong>Bie</strong>;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"VKE Viking Esport VCS #2 Team LOL LMHT\" src=\"https://dailong.asia/public/upload/tinymce/LOL%20World%20Championship/Viking%20Team%20VCS.png\" alt=\"VKE Viking Esport VCS #2 Team LOL LMHT\" width=\"20%\" height=\"100%\" /></p>\r\n<p>&nbsp;</p>\r\n<hr />\r\n<p><span style=\"text-decoration: underline;\"><span style=\"color: #e03e2d; text-decoration: underline;\"><strong><span style=\"color: #050bf5; text-decoration: underline;\">LCS Region (<em>European League of Legends Championship Series (EU LCS</em>))</span></strong></span></span></p>\r\n<p><span style=\"color: #e03e2d;\"><strong>FLY </strong></span>(FlyQuest - LCS #1): Mid - <strong>APA</strong>, Jungle - <strong>Umti</strong>, Top - <strong>Impact</strong>, Ad - <strong>Yoon</strong>, SP - <strong>CoreJJ</strong>;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"FlyQuest LCS Team LOL Logo\" src=\"https://dailong.asia/public/upload/tinymce/LOL%20World%20Championship/LCS%20FlyQuest%20LOL%20Team%20Logo.png\" alt=\"FlyQuest LCS Team LOL Logo\" width=\"20%\" height=\"100%\" /></p>\r\n<p><span style=\"color: #e03e2d;\"><strong>TL</strong></span> (Team Liquid - LCS #2): Mid - <strong>APA</strong>, Jungle - <strong>Umti</strong>, Top - <strong>Impact</strong>, Ad - <strong>Yoon</strong>, SP - <strong>CoreJJ</strong>;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Team Liquid - LCS #2 Team LOL Logo\" src=\"https://dailong.asia/public/upload/tinymce/LOL%20World%20Championship/LCS%20TL%20LOL%20Team%20Logo.png\" alt=\"Team Liquid - LCS #2 Team LOL Logo\" width=\"20%\" height=\"100%\" /></p>\r\n<p><span style=\"color: #e03e2d;\"><strong>100T</strong></span> (100 Thieves - LCS #3): Mid - <strong>Quid</strong>, Jungle - <strong>River</strong>, Top - <strong>Sniper</strong>, Ad - <strong>Tomo</strong>, SP - <strong>Eyla</strong>;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"100T (100 Thieves - LCS #3) CKTG 2024 LOL\" src=\"https://dailong.asia/public/upload/tinymce/LOL%20World%20Championship/100T%20Team%20LOL%20LCS.png\" alt=\"100T (100 Thieves - LCS #3) CKTG 2024 LOL\" width=\"20%\" height=\"100%\" /></p>\r\n<p>&nbsp;</p>\r\n<hr />\r\n<p><span style=\"font-size: 24px; color: #e03e2d;\"><strong>B&agrave;i viết đang được cập nhật đến trận chung kết</strong></span></p>\r\n<p><span style=\"color: #e03e2d;\"><em><span style=\"font-size: 24px;\">(This article will be updating until Grand final game)</span></em></span></p>\r\n<p><span style=\"text-decoration: underline; color: #000000;\"><em>C&aacute;m ơn c&aacute;c bạn đ&atilde; xem nội dung b&agrave;i viết!</em></span></p>\r\n<p><span style=\"text-decoration: underline; color: #000000;\"><em>(Thank for watching my article!)</em></span></p>', NULL, NULL, 28, '1', 'World Championship League of Legends LOL 2024 CKTG Liên Minh Huyền Thoại được tổ chức vào tháng 09.2024 và kết thúc vào tháng 10.2024 tại 3 địa điểm Berlin, Paris, London', 'World Championship, League of Legends, LOL 2024, CKTG Liên Minh Huyền Thoại, LCK, LPL, VCS, PCS ...', '2024-12-16 13:14:56', '2024-09-26 22:32:34', '2024-11-09 00:13:24', NULL);
